\begin{document}

\begin{figure}[h!]
\centering
\begin{tikzpicture}
\node[scale=0.9]{
\begin{quantikz}
\qw & \gate{R_y(\theta_1)}
      \gategroup[wires=4,steps=5,
                 style={dashed,rounded corners,inner xsep=3pt,inner ysep=4pt},
                 background,
                 label style={label position=below right,xshift=2pt,yshift=-2pt}
                ]{$\times\, D$}
